import axios from 'axios'
import { BarChart } from '../Components/Chart'

function Weeks() {
    
  
    useEffect(() => {
        const fetchInfo = async () => {
            const res = await axios.post("http://localhost:3001/getdatabase/people", {data: " "}, { headers: { accessToken: sessionStorage.getItem("accessToken")}})
            
            console.log(res)
            return res
        
        }
       fetchInfo() 
       setInformation({
        labels: fetchInfo.data.map((data) => data.hours),
        datasets: [
            {
                label: "Hours",
                data: res.data.data.map((hours) => hours.hours),
                backgroundColor: [
                    "#ffbb11",
                    "#ecf0f1",
                    "#50AF95",
                    "#f3ba2f",
                    "#2a71d0",
                    "#f4aaf3"
                  ]
            }
        ]
    })
    }, [])

    const [information, setInformation] = useState({})

    

  return (
    <>
        <BarChart chartData={information} />
    </>
  )
}

export default Weeks
